@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:BankCode a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:isIssuedBy ;
        owl:someValuesFrom atm:Bank
    ] .

atm:CashCard a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasBankCode ;
        owl:someValuesFrom atm:BankCode
    ] .

atm:isIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:hasBankCode a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:BankCode .

atm:Bank a owl:Class .
